import React from 'react';
import { useParams } from 'react-router-dom';
import './program.css';

const Program = () => {
  const { programName } = useParams();

  // Placeholder data - replace with actual data fetching logic
  const programData = {
    name: programName,
    description: `This is the ${programName} program at the University of Waterloo.`,
    requiredCredits: 120,
    coreCourses: ['MATH 135', 'MATH 136', 'CS 135', 'CS 136'],
    electiveCourses: ['ECON 101', 'PSYCH 101', 'BIOL 130', 'CHEM 120'],
  };

  return (
    <div className="program-page">
      <h1>{programData.name}</h1>
      <p className="program-description">{programData.description}</p>

      <section className="program-details">
        <h2>Program Details</h2>
        <p>Required Credits: {programData.requiredCredits}</p>

        <h3>Core Courses</h3>
        <ul>
          {programData.coreCourses.map((course, index) => (
            <li key={index}>{course}</li>
          ))}
        </ul>

        <h3>Elective Courses</h3>
        <ul>
          {programData.electiveCourses.map((course, index) => (
            <li key={index}>{course}</li>
          ))}
        </ul>
      </section>

      <section className="degree-planner">
        <h2>Degree Planner</h2>
        {/* Add degree planner component here */}
        <p>Interactive degree planner coming soon!</p>
      </section>
    </div>
  );
};

export default Program;
